import math
from collections import Counter

def count_suitable_pairs(n, k, A):
    C = Counter()
    for x in A:
        L = int(math.sqrt(x))
        FACT = dict()
        for i in range(2, L + 2):
            while x % i == 0:
                FACT[i] = FACT.get(i, 0) + 1
                x = x // i
        if x != 1:
            FACT[x] = FACT.get(x, 0) + 1
        for f in list(FACT):
            FACT[f] %= k
            if FACT[f] == 0:
                del FACT[f]
        if FACT == dict():
            C[1, 1] += 1
        else:
            RET = 1
            ALL = 1
            for f in FACT:
                RET *= f ** FACT[f]
                ALL *= f ** k
            C[RET, ALL // RET] += 1
    ANS = 1
    ANS2 = 0
    for (x, y) in C:
        if x == y:
            ANS += C[x, y] * (C[x, y] - 1) // 2
        else:
            ANS2 += C[x, y] * C[y, x]
    return ANS + ANS2 // 2

